import React from 'react'

export default function Details() {
    const divStyle = {
        marginLeft: '60px', // Adjust the left margin as needed
      };
  return (
    <div
        style={divStyle}>
      <br/>
      <br/>
      <h2>PRESIDENTIAL SUITE</h2>
      <br/>
      <span>Room Number : 99</span>
      <span>Check-in : 8.00 a.m</span>
      <span>Room Number : 99</span>
      <span>Room Number : 99</span>
    </div>
  )
}
